import { Dropdown } from 'bootstrap';
import React, { useState, useEffect } from 'react';

const ContactForm = () => {
//   const [formData, setFormData] = useState({
//     first_name: '',
//     last_name: '',
//     email: '',
//     phone: '',
//     address: '',
//     city: '',
//     state: '',
//     zip: '',
//     website: '',
